import React from 'react'

const navbarLeft = () => {
    return (
        <>
            <h1>Isardo</h1>
            <ul>
                <li><a className="navigation-button">Students</a><span className="navigation-button__indicator"></span></li>
                <li><a className="navigation-button">Lessons</a><span className="navigation-button__indicator"></span></li>
            </ul>
        </>
    )
}

export default navbarLeft
